  private safe = ( base ) => base.match( /\w/g ).join( '' )

  private encode = ( str: string ) => this.safe( Buffer.from( str ).toString( 'base64' ) )
  private decode = ( base: string ) => Buffer.from( base, 'base64' ).toString( 'ascii' )
